class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        def calc(lst1, lst2, lst3):
            result = -3 * (10**9) - 100
            for i in range(3):
                for j in range(3):
                    for k in range(3):
                        if lst1[i][1] != lst2[j][1] != lst3[k][1] != lst1[i][1]:
                            result = max(result, lst1[i][0] + lst2[j][0] + lst3[k][0])
            return result




        n = len(board)
        m = len(board[0])
        lst = []

        for i in range(n):
            tmp = sorted([
                (board[i][j], j) for j in range(m)
            ])
            lst.append(tmp[-3:])

        result = -3 * (10**9) - 100
        for i in range(n):
            for j in range(i+1, n):
                for k in range(j+1, n):
                    if lst[i][-1][0] + lst[j][-1][0] + lst[k][-1][0] <= result:
                        continue
                    resp = calc(lst[i], lst[j], lst[k])
                    result = max(resp, result)
        return result
